import { Route } from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom'
import Home from './Pages/Home'
import Chat from './Pages/Chat'

import './App.css';

function App() {
  return (
    <div className="App">
     <BrowserRouter>
      <Route path="/" element={<Home/>}/>
      <Route path="/chats" element={<Chat/>}/>
    </BrowserRouter>
    </div>
  );
}

export default App;
